import React from "react";
import "./App.css";
import HeaderComp from "./components/HeaderComponet/Header";
import Crawl from "./components/CrawlComponent/Crawl";
import styled from "styled-components";

const Fixed = styled.div`
  position: fixed;
  top: 0;
  width: 100%;
`;

const App = () => {
  return (
    <div>
      <div>
        <Fixed>
          <HeaderComp />
        </Fixed>
      </div>
      <div>
        <Crawl />
      </div>
    </div>
  );
};

export default App;
